import { Col, Container, Row } from "react-bootstrap";
import "./App.css";
import NavigationBar from "./components/NavigationBar";
import "./style/LandingPage.css";

function App() {
  return (
    <div>
      {/* intro section */}
      <div className="bg">
        <NavigationBar />
        <div>
          <Container>
            <Row>
              <Col>testing</Col>
            </Row>
          </Container>
        </div>
      </div>
      {/* end of intro section */}
    </div>
  );
}

export default App;
